#1957. Delete Characters to Make Fancy String
def makeFancyString(s):
     result = s[0:2]
     i = 2
     if len(s) < 3:
         return s
     while i < len(s)  :
        
        if s[i] == result[-1] == result[-2]:
            i += 1
        else:
             
            result += s[i]
            i += 1
     print(result)


def makeFancyString2(s):
    count = 0 
    ans = []
    tmp = s[0]
    for c in s :
        if c != tmp:
            count = 1
            tmp = c 
        else:
            count+= 1
        if count < 3:
            ans.append(c)
    return ''.join(s)

